Necesitamos:👇🏽👇🏽
* 2 berenjenas
* 1 cda de aceite de oliva 
* 3 cdas de Tahini ( pasta de sésamo)- la pueden comprar o hacer!
* 2 dientes de ajo
* 1 limón
* ¼ de taza perejil picado
* 1 yema de huevo 
Como? 
1. Cocinar  las  berenjenas directamente colocándolas en la hornalla en contacto cn el fuego hasta que vean que ya están cocidas, la cascara va cambiando de color (pueden usar este método o directamente cocinarlas al vapor o sofreírlas ! , a mi me gusta este porque le da un buen gusto)
2. Vaciar las berenjenas y reservar ese puré 
3. Procesar  en una licuadora o mixer, el puré de berenjenas, los ajos, el aceite de oliva, el limón exprimido , el perejil y la yema de huevo. Y listo!! Ya está para servir 
